import { Route, Routes } from "react-router-dom";
import Home from "./routes/home/home.routes";

const Shop = () => {
  return (
    <h1>shop test</h1>
  )
}

const App = () => {

  return (
    <Routes>
      <Route path="/home" element={
        <Home />
      } />
    </Routes>
  );
}

export default App;
